using Icatt.ServiceModel;
using Sphdhv.DeelnemerPortalApi.Interface;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using Icatt.Test.Stubbing;
using Sphdhv.DeelnemerPortalApi.Contract;
using Sphdhv.DeelnemerPortalApi.ProxyStub;

namespace Sphdhv.DeelnemerPortalApi.ProxyStub
{

    public class DeelnemerPortalApiDataCollection
    {
        public List<Verzekerde> Verzekerden { get; set; } = new List<Verzekerde>();
        public List<Polis> Polissen { get; set; } = new List<Polis>();
        public Dictionary<string, Pensioenrecht> Pensioenrechten { get; set; } = new Dictionary<string, Pensioenrecht>();
        public Dictionary<string, Pensioen> Pensioenen { get; set; } = new Dictionary<string, Pensioen>();
        public Dictionary<string, DocumentInfo> DocumentenInfo { get; set; } = new Dictionary<string, DocumentInfo>();
        public Dictionary<string, Document> Documenten { get; set; } = new Dictionary<string, Document>();


        public void AddRandomVerzekerden(int count)
        {
            for (int i = 0; i < count; i++)
            {
                Verzekerden.Add(RandomDataGenerator.CreateRandomRecord<Verzekerde>());
            }
        }
        public void AddRandomPensioen(int count)
        {
            for (int i = 0; i < count; i++)
            {
                var pensioenNr = RandomDataGenerator.CreateRandomString(7, "0123456789");
                var p = RandomDataGenerator.CreateRandomRecord<Pensioen>();
                Pensioenen.Add(pensioenNr, p);
            }
        }
        public void AddRandomPensioenRechten(int count)
        {
            for (int i = 0; i < count; i++)
            {
                var pensioenNr = RandomDataGenerator.CreateRandomString(7, "0123456789");
                var p = RandomDataGenerator.CreateRandomRecord<Pensioenrecht>();
                Pensioenrechten.Add(pensioenNr, p);
            }
        }
        public void AddRandomPolissen(int count)
        {
            for (int i = 0; i < count; i++)
            {
                Polissen.Add(RandomDataGenerator.CreateRandomRecord<Polis>());
            }
        }

        public void AddDocumentInfo(string dossierNr)
        {
            var d = RandomDataGenerator.CreateRandomRecord<DocumentInfo>();
            d.DossierGuid = dossierNr;
            d.DocumentNaam = "test.doc";
            d.DocumentId = "testString"+ dossierNr;
            DocumentenInfo.Add(dossierNr, d);
        }

        public void AddDocument(string dossierNr)
        {
            var d = new Document();
            d.Data = "";
            Documenten.Add(dossierNr, d);
        }
    }
}

public class DeelnemerPortalApiStub<TContext> : ProxyBase<IDeelnemerPortalApi, TContext>, IDeelnemerPortalApi where TContext : class
{
    public readonly StubManager<DeelnemerPortalApiDataCollection> StubManager = new StubManager<DeelnemerPortalApiDataCollection>();


    public DeelnemerPortalApiStub() : base(null, null)
    {
    }



    public DeelnemerPortalApiStub(TContext context, IFactoryContainer<TContext> env) : base(context, env)
    {
    }

    public async Task<List<Polis>> Polissen(string dossierId)
    {
        var returnVal = Task.FromResult(StubManager.DataCollection.Polissen);

        return await StubManager.Interceptors.Intercept(Polissen, dossierId, returnVal);


    }

    public async Task<Verzekerde> Verzekerde(string dossierId)
    {
        var returnValue = Task.FromResult(StubManager.DataCollection.Verzekerden.FirstOrDefault(v => v.Nummer == dossierId));

        return await StubManager.Interceptors.Intercept(Verzekerde, dossierId, returnValue);

    }

    public async Task<Verzekerde> VerzekerdeByBsn(string bsn)
    {
        var returnValue = Task.FromResult(StubManager.DataCollection.Verzekerden.FirstOrDefault(v => v.Bsn == Convert.ToInt32(bsn)));

        return await StubManager.Interceptors.Intercept(VerzekerdeByBsn, bsn, returnValue);
    }

    public async Task<List<Pensioenrecht>> Pensioenrechten(string dossierId)
    {
        var returnVal = Task.FromResult(StubManager.DataCollection.Pensioenrechten
            .Where(p => p.Key == dossierId)
            .Select(kvp => kvp.Value)
            .ToList());

        return await StubManager.Interceptors.Intercept(Pensioenrechten, dossierId, returnVal);
    }

    public async Task<Pensioen> Pensioen(string dossierId)
    {
        var returnVal = Task.FromResult(StubManager.DataCollection.Pensioenen.Where(p => p.Key == dossierId).Select(kvp => kvp.Value).FirstOrDefault());

        return await StubManager.Interceptors.Intercept(Pensioen, dossierId, returnVal);
    }

    public async Task<Document> Document(string documentId, string dossierGuid)
    {
        var returnVal = Task.FromResult(StubManager.DataCollection.Documenten.Where(p => p.Key == dossierGuid).Select(kvp => kvp.Value).FirstOrDefault());

        return await StubManager.Interceptors.Intercept(Document, documentId, dossierGuid, returnVal);
    }

    public async Task<List<DocumentInfo>> DocumentInfo(string dossierGuid, string documentId = null)
    {
        var returnVal = Task.FromResult(StubManager.DataCollection.DocumentenInfo
            .Where(p => p.Key == dossierGuid)
            .Select(kvp => kvp.Value)
            .ToList());

        return await StubManager.Interceptors.Intercept(DocumentInfo, dossierGuid, documentId, returnVal);
    }
}

